// src/pages/AdminDetails.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate, useParams, Link } from 'react-router-dom';
import api from '../../services/api';

export default function AdminDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [admin, setAdmin] = useState(null);
  const [form, setForm] = useState({ nome: '', email: '', senha: '', nivelAcesso: 'admin', ativo: true });
  const [editando, setEditando] = useState(false);

  useEffect(() => {
    api.get(`/admins/${id}`).then((res) => {
      setAdmin(res.data);
      setForm(res.data);
    });
  }, [id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm((prev) => ({ ...prev, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    await api.put(`/admins/${id}`, form);
    setEditando(false);
    navigate('/admins');
  };

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este admin?')) {
      await api.delete(`/admins/${id}`);
      navigate('/admins');
    }
  };

  if (!admin) return <p>Carregando...</p>;

  return (
    <div className="container my-5">
      <h2>Detalhes do Admin</h2>
      <Link to="/admins" className="btn btn-secondary mb-3">â Voltar</Link>

      {editando ? (
        <form onSubmit={handleUpdate}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Email</label>
            <input name="email" className="form-control" value={form.email} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Senha</label>
            <input name="senha" className="form-control" value={form.senha} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">NÃ­vel de Acesso</label>
            <select name="nivelAcesso" className="form-select" value={form.nivelAcesso} onChange={handleChange}>
              <option value="super">Super</option>
              <option value="admin">Admin</option>
              <option value="moderador">Moderador</option>
            </select>
          </div>

          <div className="form-check mb-3">
            <input className="form-check-input" type="checkbox" name="ativo" checked={form.ativo} onChange={handleChange} />
            <label className="form-check-label">Ativo</label>
          </div>

          <button type="submit" className="btn btn-primary">Salvar</button>
        </form>
      ) : (
        <div>
          <p><strong>Nome:</strong> {admin.nome}</p>
          <p><strong>Email:</strong> {admin.email}</p>
          <p><strong>NÃ­vel de Acesso:</strong> {admin.nivelAcesso}</p>
          <p><strong>Ativo:</strong> {admin.ativo ? 'Sim' : 'NÃ£o'}</p>

          <Link to={`/admins/${id}/editar`} className="btn btn-warning me-2">Editar</Link>
          <button className="btn btn-danger" onClick={handleDelete}>Excluir</button>
        </div>
      )}
    </div>
  );
}
